window.bookSummaryJSON = "<p>Mighty Greyboar, the world's greatest professional strangler, is dissatisfied with his lot in life. The work is steady and the pay is good, but what, he wonders, is the point of it all.</p> <p>But when he learns that there is a Supreme Philosophy of Life, Greyboar the Strangler is born again! Still, just how can a professional man in good standing pay the bills with all this philosophical exploration getting in the way.</p> <p>That's what his hard-headed agent and manager Ignace wants to know! And Ignace's skepticism turns quickly into outright horror when Greyboar's philosophical preoccupation leads to one disaster after another...Before you know it, Greyboar the Strangler and his disgruntled manager find themselves embroiled with an abbess at odds with her deity, heretics on the run, dwarves needing to be rescued, and then - worst of all!</p> <p>Greyboar's long-estranged sister Gwendolyn, political activist and revolutionary, comes back to town asking Greyboar's help in an insane mission to the underworld. It's purely a noble cause, one which no self-respecting assassin would touch for a moment. But in the pursuit of enlightenment, anything can happen.</p> <p><b>Contains mature themes.</b></p>"; 
